import { Route } from 'react-router-dom'
import logo from '../../images/logo/Vector.svg'

export default function Header({ logge}) {
  return (
    <header className="header">
      <img
      className="header__logo"
      src={logo}
      alt="логотип Mesto"
      />
    </header>
  )
}
